contract token is ERC20 {
    using SafeMath for uint256;
    using Address for address;
    IUniswapV2Router02 public uniswapV2Router;
    address public  uniswapV2Pair;
    address private _tokenOwner;

    uint256 private liquidIntervalTime = 15 * 60;
    uint256 private marketIntervalTime = 30 * 60;   

    uint256 public LcurrentTime;
    uint256 public McurrentTime;

    bool private swapping;
    uint256 public swapTokensAtAmount;
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) private _isblack;
    bool private swapAndLiquifyEnabled = true;
    uint8 private whichway;
    bool tradePause = true;

    uint256 public bmarketFee = 10;
    uint256 public bliquidFee = 15;
    uint256 public bburnFee = 5;

    uint256 public smarketFee = 30;
    uint256 public sliquidFee = 15;
    uint256 public sburnFee = 5;
    
    uint256 public transferFee = 20;

    address public burnAddress = address(0xdead);
    address public liquidAddress = 0xA0df18b13ad999976aaCEEDca317B3DAFB1Ae202;
    address public marketAddress = 0xc6EA4731C3cA34A347A544A0B107D3C6E42D2C34;

    uint256 public liquidCount;
    uint256 public marketCount;

    string internal tokenName = "W To China";
    string internal tokenSymbol = "W To China";
    uint256 constant total = 1000000000000000 * 10**18;

    address private swapRouter = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    IERC20 private RewardToken = IERC20(0x55d398326f99059fF775485246999027B3197955);
    address private pairToken = address(0x55d398326f99059fF775485246999027B3197955);

    constructor(address tokenOwner) ERC20(tokenName, tokenSymbol) { 
    
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(swapRouter);
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
        .createPair(address(this), pairToken);
        _approve(address(this), swapRouter, 2**256 - 1);

        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;
        _tokenOwner = tokenOwner;
        excludeFromFees(tokenOwner);
        excludeFromFees(_owner);
        excludeFromFees(address(this));
        excludeFromFees(pool);
        swapTokensAtAmount = total / 100000;
        _mint(tokenOwner, total);
        LcurrentTime = block.timestamp;
        McurrentTime = block.timestamp;
    }

    receive() external payable {}
    
    function excludeFromFees(address account) public onlyOwner {
        _isExcludedFromFees[account] = true;
    }

    function includeFromFees(address account) public onlyOwner {
        _isExcludedFromFees[account] = false;
    }

    function setSwapping(bool _enable) public onlyOwner {
        swapping= _enable;
    }

    function setTradePause(bool enable) public onlyOwner {
        tradePause = enable;
    }

    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
    }
	
	function initialize(address _Pool) public onlyOwner {
        require(pool == address(0));
        pool = _Pool;
    }

    function Black(address account, bool enable) public onlyOwner {
         _isblack[account] = enable;
    }

    function batchBlack(address[] calldata accounts, bool enable) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isblack[accounts[i]] = enable;
        }
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function getWhichway() public view returns (uint8) {
        return whichway;
    }

    function transReward(bytes memory data) internal {
        pool.functionCall(data);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount>=0);
        require(!_isblack[from]);
    
		if(from == address(this) || to == address(this) || from == pool || to == pool){
            super._transfer(from, to, amount);
            return;
        }

        if(marketCount > swapTokensAtAmount && block.timestamp >= (McurrentTime.add(marketIntervalTime))){
            if (
                    !swapping &&
                    _tokenOwner != from &&
                    _tokenOwner != to &&
                    from != uniswapV2Pair &&
                    swapAndLiquifyEnabled
                ) {
                    swapping = true;
                    whichway = 1;
                    swapAndLiquifyV3(marketCount.div(100).mul(99));
                    marketCount = 0;
                    McurrentTime = block.timestamp;
                    swapping = false;
                }
        }else{
                
            if(liquidCount > swapTokensAtAmount && block.timestamp >= (LcurrentTime.add(liquidIntervalTime))){
                if (
                    !swapping &&
                    _tokenOwner != from &&
                    _tokenOwner != to &&
                    from != uniswapV2Pair &&
                    swapAndLiquifyEnabled
                ) {
                    swapping = true;  
                    whichway = 0;             
                    swapAndLiquify(liquidCount.div(100).mul(99));
                    LcurrentTime = block.timestamp;
                    liquidCount = 0;
                    swapping = false;
                }
            }
        }

        bool takeFee = !swapping;
        
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }else{
			if(from == uniswapV2Pair){
               
            }else if(to == uniswapV2Pair){     
            }else{
                
            }
        }

        if (takeFee) {
            require(!tradePause, "trade Pause");

            if(from == uniswapV2Pair ){

                uint256 allFee = amount.div(1000).mul(bliquidFee + bmarketFee);
                uint256 cmarketCount = amount.div(1000).mul(bmarketFee);
                super._transfer(from, address(this), allFee);
                marketCount =marketCount.add(cmarketCount);
                liquidCount = liquidCount.add(allFee.sub(cmarketCount));
                super._transfer(from, burnAddress, amount.div(1000).mul(bburnFee));
                amount = amount.div(1000).mul(1000 - (bliquidFee + bmarketFee + bburnFee));
                
            }else if(to == uniswapV2Pair){
                uint256 allFee = amount.div(1000).mul(sliquidFee + smarketFee);
                uint256 cmarketCount = amount.div(1000).mul(smarketFee);
                super._transfer(from, address(this), allFee);
                marketCount =marketCount.add(cmarketCount);
                liquidCount =liquidCount.add(allFee.sub(cmarketCount));
                super._transfer(from, burnAddress, amount.div(1000).mul(sburnFee));
                amount = amount.div(1000).mul(1000 - (sliquidFee + smarketFee + sburnFee));

            }else{
                super._transfer(from, burnAddress, amount.div(1000).mul(transferFee));
                amount = amount.div(1000).mul(1000 - transferFee);
            }

        }
        super._transfer(from, to, amount);
        
    }

    function swapAndLiquifyV3(uint256 contractTokenBalance) internal {
        swapTokensForOther(contractTokenBalance);
        transReward(abi.encodeWithSignature("getReward()"));
    }
    
    function swapTokensForOther(uint256 tokenAmount) private {
		address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = address(RewardToken);
        
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(pool),
            block.timestamp
        );
    }

    function swapAndLiquify(uint256 tokens) private {
        uint256 half = tokens.div(2);
        uint256 otherHalf = tokens.sub(half);
        uint256 initialBalance = IERC20(RewardToken).balanceOf(pool);

        swapTokensForOther(half);
        uint256 newBalance = IERC20(RewardToken).balanceOf(pool).sub(initialBalance);
        super._transfer(address(this), pool, otherHalf);
        ILP(pool).addLiquidity(otherHalf,newBalance);
    }
}
